import React from 'react'
import { View, Text, StyleSheet } from 'react-native'

export default function Order() {
    return (
        <View style={s.cont}>
            <Text>Zamówienie: </Text>
            <Text>Imię: </Text>
            <Text>Nazwisko: </Text>
            <Text>Email: </Text>
            <Text>Miasto: </Text>
            <Text>Numer tel: </Text>
            <Text>Kod poczt: </Text>
            <Text>Ulica i numer: </Text>
        </View>
    )
}

const s = StyleSheet.create({
    cont: {
        flex: 1,
        backgroundColor: "#fff",
    },
});
